    "completed_date": completedDate?.toIso8601String(),    "latitude": latitude,    "longitude": longitude,    "issued_by": issuedBy,    "success": success,  };}class AssignedTo {  AssignedTo({    this.id,    this.fullName,    this.email,    this.isAdmin,    this.isStaff,  });  int? id;  String? fullName;  String? email;  bool? isAdmin;  bool? isStaff;  factory AssignedTo.fromJson(Map<String, dynamic> json) => AssignedTo(    id: json["id"],    fullName: json["full_name"],    email: json["email"],    isAdmin: json["is_admin"],    isStaff: json["is_staff"],  );  Map<String, dynamic> toJson() => {    "id": id,    "full_name": fullName,    "email": email,    "is_admin": isAdmin,    "is_staff": isStaff,  };}